var React = require('react');


class Table extends React.Component {
  render() {
    const listOfRecipes = this.props.recipe.map(item=>{
        let index = this.props.recipe.indexOf(item) + 1;
        let url = '/recipes/'+(index);

        if(item.utensils.length >1){
            const listOfUtensils = item.utensils.map(utensils=>{
                return <li>{utensils}</li>
            })
        }else if(item.utensils.length === 0){
            const listOfUtensils = "-";
        }else if(item.utensils.length ===1){
            const listOfUtensils = item.utensils;
        }

        if(item.seasonings.length >1){
            const listOfSeasonings = item.seasonings.map(seasonings=>{
                return <li>{seasonings}</li>
            })
        }else if(item.seasonings.length === 0){
            const listOfSeasonings = "-"
        }else if(item.seasonings.length === 1) {
            const listOfSeasonings = item.seasonings
        }

        if(item.ingredients.length >1){
            const listOfIngredients = item.ingredients.map(ingredients=>{
                return <li>{ingredients}</li>
            })
        }else if(item.ingredients.length === 0){
            const listOfIngredients = "-"
        }else if(item.ingredients.length ===1){
            const listOfIngredients = item.ingredients
        }

        return <tr>
                <td><a href={url}>{item.title}</a></td>
                <td>{listOfUtensils}</td>
                <td>{listOfSeasonings}</td>
                <td>{listOfIngredients}</td>
                </tr>
    })

    return (
        <table className="table table-hover table-bordered">
            <thead>
                <tr className="bg-success text-white">
                    <th>Dish Name</th>
                    <th>Utensils</th>
                    <th>Seasonings</th>
                    <th>Ingredients</th>
                </tr>
                {listOfRecipes}
            </thead>
        </table>
    );
  }
}

module.exports = Table;
